def count_substrings(s, k):
    n = len(s)
    left = 0
    zero_count = 0
    one_count = 0
    total_count = 0

    for right in range(n):
        if s[right] == '0':
            zero_count += 1
        else:
            one_count += 1

        while zero_count > k and one_count > k:
            if s[left] == '0':
                zero_count -= 1
            else:
                one_count -= 1
            left += 1

        total_count += right - left + 1

    return total_count

